import React from 'react';
import Layout from '../../component/layout';

class CreateCampaign extends React.Component{
    render(){
    return <Layout>
            <form class="ui form">
              <div class="field">
                <label>Minimum Contribution</label>
                <input type="text" name="min-contribution" placeholder="Minimum Contribution"/>
              </div>
            
              <button primary class="ui button" type="submit">Create</button>
            </form>
            </Layout>;
    
}
}
export default CreateCampaign;
